script: |
  super -f text -I q9700.spq | sort > q9700.out

inputs:
  - name: q9700.spq
    data: |
      SELECT - + 94 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - ( - 42 ) BETWEEN ( - col2 - 88 ) AND col1 * + col0 * + - col0;
  - name: tab1

outputs:
  - name: q9700.out
    data: |
      -94
      -94
      -94
